actions.script:
$scope.ACTIONS.MESSAGE.STATIC("Silvano Real",
[
  "$amigo, crees que te vas a escapar sin la revancha?!",
  "Esta vez voy a demostrarte el poder que tiene un principe"
],function(){

  $scope.ACTIONS.POKEMON.BATTLESTART("Silvano Real","revenge",function(){

    $scope.ACTIONS.MESSAGE.STATIC("Silvano Real_",
      [
        "Sigo sin creer que esto sea posible!, la magia me pertenece",
		"Voy a adelantarme, no vas a progresar primero que yo!",
        "Voy a llegar a derrotar el siguiente líder",
        "NO!, me vas a ganar!"
      ],function(){
			$scope.ACTIONS.NPC.MOVE("Silvano Real", 14, 3, function () {
			$scope.ACTIONS.PROGRESS.SETNATURAL('SilvanoPelea2');
			$scope.ACTIONS.PLAYER.CLEARASSAULT();   
		});
    });

  });



});
